import{_ as e,o as t,c as a,R as n}from"./chunks/framework.5065ad62.js";const g=JSON.parse('{"title":"Labctl config reference","description":"","frontmatter":{"cli":"labctl"},"headers":[],"relativePath":"reference/config.md","filePath":"reference/config.md","lastUpdated":1689775819000}'),o={name:"reference/config.md"},s=n(`<h1 id="labctl-config-reference" tabindex="-1">Labctl config reference <a class="header-anchor" href="#labctl-config-reference" aria-label="Permalink to &quot;Labctl config reference&quot;">​</a></h1><h2 id="cli-commands" tabindex="-1">CLI commands <a class="header-anchor" href="#cli-commands" aria-label="Permalink to &quot;CLI commands&quot;">​</a></h2><p>The CLI commands under <code>labctl config</code> allows you to interact with the <a href="/guide/config-engine">Config Engine</a>. It allows you to send commands to the router, render templates, or simply inspect one of the intermediate stages (variables &amp; templates).</p><details class="details custom-block"><summary><code>labctl config --help</code></summary><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">Usage: labctl config &lt;command&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">Render a template.</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">Flags:</span></span>
<span class="line"><span style="color:#A6ACCD;">  -h, --help                                 Show context-sensitive help.</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">  -t, --topo=STRING                          topology file</span></span>
<span class="line"><span style="color:#A6ACCD;">  -p, --template-paths=TEMPLATE-PATHS,...    paths to search for templates</span></span>
<span class="line"><span style="color:#A6ACCD;">  -l, --template-list=TEMPLATE-LIST,...      template names to render</span></span>
<span class="line"><span style="color:#A6ACCD;">  -f, --filter=FILTER,...                    nodes to include</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">Global Flags</span></span>
<span class="line"><span style="color:#A6ACCD;">  -d, --debug=INT          Enable debug mode.</span></span>
<span class="line"><span style="color:#A6ACCD;">      --settings=STRING    Settings yaml file.</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">Commands:</span></span>
<span class="line"><span style="color:#A6ACCD;">  config commit      Commit configuration on the node.</span></span>
<span class="line"><span style="color:#A6ACCD;">  config compare     Compare rendered templates to the node&#39;s config.</span></span>
<span class="line"><span style="color:#A6ACCD;">  config send        Send commands to the node (i.e. show)</span></span>
<span class="line"><span style="color:#A6ACCD;">  config template    Show rendered templates.</span></span>
<span class="line"><span style="color:#A6ACCD;">  config vars        Show variable inputs.</span></span></code></pre></div></details><p>The available commands include</p><h3 id="config-vars" tabindex="-1">config vars <a class="header-anchor" href="#config-vars" aria-label="Permalink to &quot;config vars&quot;">​</a></h3><p>The <code>config vars</code> command will prepare all the variables required for templating and display them on the console. This will not attempt to render any template</p><h3 id="config-template" tabindex="-1">config template <a class="header-anchor" href="#config-template" aria-label="Permalink to &quot;config template&quot;">​</a></h3><p>The <code>config template</code> command will render the templates and display the output on the terminal. This allows you to test your templates without sending anyting to the nodes</p><h3 id="config-compare" tabindex="-1">config compare <a class="header-anchor" href="#config-compare" aria-label="Permalink to &quot;config compare&quot;">​</a></h3><p>The <code>config compare</code> command will render the template and send it to the node with a compare transaction. At the end of the transaction the changes will be discarded. This allows you to see what changes the template in question will have on the node&#39;s configuration</p><p>Note: This relies on the capability of the target node to support transactions.</p><h3 id="config-commit" tabindex="-1">config commit <a class="header-anchor" href="#config-commit" aria-label="Permalink to &quot;config commit&quot;">​</a></h3><p>The <code>config commit</code> command will render the templates and commit the configuration to the target node.</p><h3 id="config-send" tabindex="-1">config send <a class="header-anchor" href="#config-send" aria-label="Permalink to &quot;config send&quot;">​</a></h3><p>The <code>config send</code> command will render the templates and send the commands to the target node without any transactions. This allows you to do show commands on the target node.</p><h2 id="cli-flags" tabindex="-1">CLI flags <a class="header-anchor" href="#cli-flags" aria-label="Permalink to &quot;CLI flags&quot;">​</a></h2><p>The following flags are available for the config commands</p><table><thead><tr><th style="text-align:left;">Flag</th><th></th><th></th><th>Description</th></tr></thead><tbody><tr><td style="text-align:left;"><code>--topo</code></td><td><code>-t</code></td><td>✔</td><td>the topology file</td></tr><tr><td style="text-align:left;"><code>--template-paths</code></td><td><code>-p</code></td><td>✔</td><td>paths to search for templates (in order)</td></tr><tr><td style="text-align:left;"><code>--template-list</code></td><td><code>-l</code></td><td>✔</td><td>template names to render</td></tr><tr><td style="text-align:left;"><code>--filter</code></td><td><code>-f</code></td><td></td><td>nodes to include</td></tr><tr><td style="text-align:left;"><code>--debug</code></td><td><code>-d</code></td><td></td><td>debug count, i.e. <code>-d</code>, <code>-ddd</code> or <code>--debug=3</code></td></tr><tr><td style="text-align:left;"><code>--settings</code></td><td></td><td></td><td>Settings file</td></tr></tbody></table><h2 id="examples" tabindex="-1">Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;Examples&quot;">​</a></h2><p><code>labctl config vars</code></p>`,21),l=[s];function c(d,i,r,p,h,m){return t(),a("div",null,l)}const u=e(o,[["render",c]]);export{g as __pageData,u as default};
